 )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1255","type":"AdaptiveTicker"},{"attributes":{},"id":"1022","type":"ResetTool"},{"attributes":{},"id":"1243","type":"BasicTickFormatter"},{"attributes":{"formatter":{"id":"1241"},"ticker":{"id":"1051"},"visible":false},"id":"1050","type":"LinearAxis"},{"attributes":{"child":{"id":"1072"},"title":"Worker Profile (administrative)"},"id":"1213","type":"Panel"},{"attributes":{"child":{"id":"1037"},"title":"Scheduler Profile (administrative)"},
